import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents", "sap_fiori_3", defaultTheme);
export default ".ui5-popup-frame{width:0;height:0;display:none;visibility:visible}:host([opened]) .ui5-popup-frame{display:inline}.ui5-popup-root{min-width:6.25rem;box-sizing:border-box;outline:none;max-width:100%;max-height:100%;background:var(--sapGroup_ContentBackground);border:none;box-shadow:var(--sapContent_Shadow2);border-radius:.25rem;min-height:2rem}@media screen and (-ms-high-contrast:active){.ui5-popup-root{border:1px solid var(--sapPageFooter_BorderColor)}}.ui5-popup-root .ui5-popup-header{margin:0;color:var(--sapPageHeader_TextColor);font-size:1rem;font-weight:400;font-family:var(--sapFontFamily);border-bottom:1px solid var(--sapPageFooter_BorderColor)}.ui5-popup-root .ui5-popup-headerText{padding:0 .25rem;text-align:center;height:3rem;line-height:3rem}.ui5-popup-root .ui5-popup-footer{font-size:1rem;font-weight:400;font-family:var(--sapFontFamily);background:var(--sapPageFooter_Background);border-top:1px solid var(--sapPageFooter_BorderColor);color:var(--sapPageFooter_TextColor)}.ui5-popup-root .ui5-popup-content{overflow:auto;position:relative;box-sizing:border-box;background-color:var(--sapGroup_ContentBackground);border-radius:.25rem;flex-grow:1;width:100%}.ui5-popup-root .ui5-popup-content,.ui5-popup-root .ui5-popup-footer{border-bottom-left-radius:.25rem;border-bottom-right-radius:.25rem}.ui5-popup-root .ui5-popup-scroll{vertical-align:middle;box-sizing:border-box;padding:var(--_ui5_popover_content_padding)}.ui5-popup-BLy{background-color:#000;opacity:.6;filter:alpha(opacity=60);top:0;left:0;right:0;bottom:0;position:fixed;outline:0 none}.ui5-popup-blockLayer{visibility:visible}.ui5-popup-blockLayer--hidden{display:none}";
